INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'Venemaa saadab USA suursaadiku riigist välja', 'Kreml on teinud ettepaneku, et USA suursaadik Venemaal John Sullivan naaseks konsultatsioonide tarbeks USA-sse.\r\nMoskva ja Washingtoni vahel mullitab tõsine diplomaatiline kriis, kirjutas Interfax. Täna teatas Vene välisminister Sergei Lavrov 10 USA diplomaadi riigist välja saatmisest. Eile kehtestas USA sanktsioonid mitmele järjekordsele Vene ametnikule ja oligarhile ning nendega seotud organisatsioonidele ja ettevõtetele.\r\n\r\nVenemaa välisminister Sergei Lavrov avaldas Sullivanile tehtud ettepaneku pressikonverentsil, mille käigus ta ütles, et Moskva palub kümnel USA diplomaadil riigist lahkuda kättemaksuks sama arvu Venemaa diplomaatide väljasaatmise eest.', , 4, 5);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'Tõnis Mägi annab oma lugudele vene keeles uue hingamise', 'Sarnaselt Anne Veskile ja Jaak Joalale saab peagi ka Tõni Mägi laule vene keeles kuulata.\r\nMägi rääkis "Vikerhommikus", et idee venekeelsete lauludega album teha tekkis tal koroonaajal kodus pabereid korrastades.\r\n\r\n"Mul jäi pilk peale sellele loole ja siis ma mõtlesin, et aga miks ma ei võiks veel mõnele oma loole venekeelset teksti teha? Seda enam, et eelmisel aastal möödus 40 aastat olümpiamängudest ja ma arvan, et ma andsin erinevatesse kohtadesse kaheksa või üheksa intervjuud ja kõik nad ütlesid, et minu lauldud muusikat, mis sai siis kunagi 40 aastat tagasi lauldud, mängitakse siiamaani igal pool raadiotes," kõneles Mägi', , 5, 4);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Irja Lutsar: vaktsiini ei tehtud selleks, et inimesed saaks minna Korfule suvitama või ööklubisse', 'Vaata siit, millest Maalehe värskes numbris veel juttu!\r\n\r\nTeie olete vaktsineeritud ja mina olen saanud ühe doosi Pfizerit. Kas omavahel vesteldes peaksime siin praegu maske kandma?\r\n\r\nPõhimõtteliselt ei peaks. Avalikus ruumis ma kannan maski, seal on liiga raske vahet teha, kes on vaktsineeritud ja kes mitte. Minu kabinet ei ole avalik ruum ja oma töökollektiivis koos olles me ei ole siin maske kandnud, nagu ka mitte pere keskel. Mis mõte siis vaktsiinil üldse oleks?\r\n\r\nPraeguse kogemuse kohaselt tundub, et vaktsiinid suudavad kaitsta?\r\n\r\nVäga hästi suudavad. On olnud juhtumeid, kus peres on vaktsineeritud meditsiinitöötaja ning kui keegi teine perest haigestub, siis tema jääb terveks või siis on sümptomid väga kerged.\r\n\r\nMinu teada on olnud vaid üks juhtum, kus vaktsineeritud inimene on raskete sümptomite tõttu haiglasse sattunud.', , 3, 4);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(5, '\r\nMeenutades Alo Mattiisenit', 'Vaata siit, millest Maalehe värskes numbris veel juttu!\r\n\r\nEestimaa kevad-suvi 1988 oli kordumatu kõigile ja igaühele eraldi. ETV2 "Teemaõhtu" raames jõuab eetrisse samal aastal Eesti Telefilmis valminud „Volikiri Alo Mattiisenile“ kus kõlavad katkendid süidist "Ajaga silmitsi", Esimesest sümfooniast ja isamaalistest lauludest.', , 5, 3);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(7, 'ASI SELGEKS | Kuidas karulaugu korjamisega loodusest ikkagi on. Kas saab trahvi, kui palju ja millal?', 'Karulauk kuulub Eestis III kaitsekategooria liikide hulka. „Karulauk on meil paiguti levinud ja heades kasvukohtades tavaline liik, kuid tema seisund vajab jälgimist. Selleks, et liigi levik ja arvukus ohtu ei satuks, on looduskaitseseaduses sellega ümber käimisele sätestatud piirangud,“ seletas Keskkonnaameti liigikaitse büroo juhataja Marju Erit.\r\n\r\nLoodusest tohib karulauku korjata mõistlikul hulgal ja enda tarbeks. Kui ühest kasvukohast on juba paljudelt taimedelt lehti ära nopitud, ei tasu sellest kasvukohast rohkem karulauku korjata. Vastasel juhul võib see kasvukoht hääbuda.\r\n\r\nKuidas korjata karulauku nii, et tema kasvukoht saaks säilida?', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(8, 'Kuninglik perekond avaldas Philipi matuste eel haruldase pildi', 'Briti kuningliku pere Instagramis avaldati foto, kus kuninganna Elizabeth II on koos prints Philipiga Šoti mägismaal.\r\n"Tema Majesteet ja kuninglik pere on tänuliku kõigi kaastundeavalduste eest üle kogu maailma ning neid liigutab, et nii paljud inimesed jagavad hertsogi elu tähistamiseks temast toredaid mälestusi."\r\n\r\n9. aprillil surnud prints Philipi matusetseremoonia toimub Windsori lossi Püha George''i kabelis täna kell 15.00 kohaliku aja järgi. Eesti aja järgi kell 17:00.', , 2, 2);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(9, 'Tõnis Mägi annab oma lugudele vene keeles uue hingamise', 'Sarnaselt Anne Veskile ja Jaak Joalale saab peagi ka Tõni Mägi laule vene keeles kuulata.\r\nMägi rääkis "Vikerhommikus", et idee venekeelsete lauludega album teha tekkis tal koroonaajal kodus pabereid korrastades.\r\n\r\n"Mul jäi pilk peale sellele loole ja siis ma mõtlesin, et aga miks ma ei võiks veel mõnele oma loole venekeelset teksti teha? Seda enam, et eelmisel aastal möödus 40 aastat olümpiamängudest ja ma arvan, et ma andsin erinevatesse kohtadesse kaheksa või üheksa intervjuud ja kõik nad ütlesid, et minu lauldud muusikat, mis sai siis kunagi 40 aastat tagasi lauldud, mängitakse siiamaani igal pool raadiotes," kõneles Mägi', , 5, 4);

